import React, { useEffect } from 'react';
import './Footer.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFacebookF, faTwitter, faGooglePlusG } from '@fortawesome/free-brands-svg-icons';
import { faPhone, faEnvelope, faMapMarkerAlt } from '@fortawesome/free-solid-svg-icons';

const Footer = () => {
  useEffect(() => {
    setTimeout(() => {
      document.querySelector('.contact-info').classList.add('active');
      document.querySelector('.about-info').classList.add('active');

      document.querySelector('.courses-info').classList.add('active');
    }, 100);
  }, []);

  return (
    <footer className="footer">
      <h2>Tanuja</h2>
      <div className="columns">
        <div className="contact">
          <h3>Contact us anytime</h3>
          <div className="contact-info">
            <p><FontAwesomeIcon icon={faPhone} /> +44 3069 990134</p>
            <p><FontAwesomeIcon icon={faEnvelope} /> info@celeste.co.uk</p>
            <p><FontAwesomeIcon icon={faMapMarkerAlt} /> 7 Kings Rd, Portsmouth, Southsea, PO5 4DJ, UK</p>
          </div>
        </div>
        <div className="about">
          <h3>More about Celeste</h3>
          <div className="about-info">
            <ul>
              <li><a href="#">About us</a></li>
              <li><a href="#">Management team</a></li>
              <li><a href="#">Contact</a></li>
              <li><a href="#">Location</a></li>
              <li><a href="#">Pricing</a></li>
            </ul>
          </div>
        </div>
        <div className="courses">
          <h3>Latest courses</h3>
          <div className="courses-info">
            <ul>
              <li><a href="#">What is life coaching</a></li>
              <li><a href="#">Life coaching and your family</a></li>
              <li><a href="#">Find your life purpose</a></li>
              <li><a href="#">Tap into endless motivation</a></li>
              <li><a href="#">Coaching focuses on your future</a></li>
            </ul>
          </div>
        </div>
      </div>
      <div className="social-icons">
        <a href="#"><FontAwesomeIcon icon={faFacebookF} /></a>
        <a href="#"><FontAwesomeIcon icon={faTwitter} /></a>
        <a href="#"><FontAwesomeIcon icon={faGooglePlusG} /></a>
      </div>
    </footer>
  );
};

export default Footer;
